<script>
// @ is an alias to /src
import { TweenMax } from 'gsap'
import { TimelineLite } from 'gsap'
import '../../gsap-bonus/DrawSVGPlugin'
import Parallax from 'parallax-js'

export default {
  
  mounted() {
    var scene = document.getElementById('scene');
    var parallaxInstance = new Parallax(scene, {
      relativeInput: true,
      pointerEvents: true,
      selector: '.layer',
      frictionX: 0.03,
      frictionY: 0.03
    });    
  
  var nxtHelene = document.querySelector('.nxtHelene');
    nxtHelene.addEventListener('click', function(){
      tlWeddingDress.play();
    });


  var tlHelene = new TimelineLite();
  var tlWeddingDress = new TimelineLite({ paused: true });

  tlHelene.staggerFrom(".heleneFace", 2, {drawSVG:0}, 0.1, "face")
  .staggerFrom(".heleneHair", 2, {drawSVG:0}, 0.05, "face+=2")
  .staggerFrom(".heleneCollar", 2, {drawSVG:0}, 0.1, "face+=4")
  .staggerFrom(".heleneTorso", 2, {drawSVG:0}, 0.1, "face+=6")
  .staggerFrom(".heleneArms", 1, {drawSVG:0}, 0.05, "face+=6")
  .staggerFrom(".heleneDress", 2, {drawSVG:0}, -0.1, "face+=8")

  tlWeddingDress.fromTo(".infoHelene", 2, {opacity:1}, {opacity:0})
  .add(function(){ document.querySelector(".infoHelene").style.display = "none"})
  .add(function(){ document.querySelector(".infoWeddingDress").style.display = "block"})
  .fromTo(".infoWeddingDress", 2, {opacity:0}, {opacity:1})
  .staggerFrom(".rubensFace", 2, {drawSVG:0}, 0.1, "face")
  .staggerFrom(".rubensHair", 0.5, {drawSVG:0}, -0.05, "face+=1")
  .staggerFrom(".rubensNeck", 2, {drawSVG:0}, 0.1, "face+=3")
  .staggerFrom(".rubensClothes", 2, {drawSVG:0}, 0.1, "face+=4")
  .staggerFrom(".rubensHands", 2, {drawSVG:0}, 0.1, "face+=4")
  .staggerFrom(".rubensCanvas", 2, {drawSVG:0}, 0.1, "face+=6")
  .fromTo(".rubensBg", 2, {opacity:0}, {opacity:1}, "face+=7");

  }
}
</script>

